import React, { Component } from "react"

export default class SymptomCard extends Component {

    render() {
        return (
            <>
                <div className="card">
                    <div className="card-body">
                        <h5 className="card-title">
                        {console.log(this.props)}
                        </h5>
                    </div>
                </div>
            </>
        )
    }
}
